Handlebars.registerHelper("selected", function(a, b) {
    return a === b ? " selected" : ""
}), Handlebars.registerHelper("selectLabel", function(a, b, c) {
    var d = a;
    return a.length > b && (d = a.substr(0, b) + "..."), c && "" !== c && (d = d + " (" + c.toLowerCase() + ")"), new Handlebars.SafeString(d)
});
